        function show_msg(msg, id) {
            show_btn();
            $('.err').html(msg);
            $('#err').html(msg);
            remove_alert();
            $('.alert_show').addClass('alert-danger');
            $('.icon_alert').removeClass('fa-check').addClass('fa-info');
            $('#' + id + '').focus();
            hidden_loading();
        }
        function show_msg_noaccess(msg, url) {
            show_btn();
            $('#err').html(msg);
            remove_alert();
            $('.alert_show').addClass('alert-danger');
            $('.icon_alert').removeClass('fa-check').addClass('fa-info');
            hidden_loading();
            settimouts(msg,url);
        }
        function settimouts(msg,url){
            var delay = 1000;
            setTimeout(function(){ 
                if (url === null) {
                    window.location.reload(true);
                } else {
                    redirect_url(url);
                }
            }, delay);
        }
        function show_msg_alert (msg,id){
            $('#err').html(msg);
            $('.alert-danger').removeClass('hidden');
            $('.alert_show').removeClass('alert-success');
            $('#'+id+'').focus();
            alert(msg);
            show_btn();
            hidden_loading();
        }
        function islogin(msg, id) {
            $('#err').html(msg);
            remove_alert();
            $('.alert_show').addClass('alert-danger');
            $('#' + id + '').focus();
            $('#shows').modal('show');
            show_btn();
            return false;
        }
